// components/User/ViewRequests.jsx
import React, { useEffect, useState } from 'react';
import styles from './ViewRequests.module.css';

const dummyData = [
  { id: 1, type: 'Water', status: 'Pending' },
  { id: 2, type: 'Internet', status: 'Completed' },
];

const ViewRequests = () => {
  const [requests, setRequests] = useState([]);

  useEffect(() => {
    // Normally fetch from API
    setRequests(dummyData);
  }, []);

  return (
    <div className={styles.container}>
      <h2>My Service Requests</h2>
      <table>
        <thead>
          <tr>
            <th>Type</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {requests.map((req) => (
            <tr key={req.id}>
              <td>{req.type}</td>
              <td>{req.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ViewRequests;
